      this.workingDamage.copy(this.damage.totalPickDamagePerTurn);
      tile.onTileDamaged(this.workingDamage);
      if (tile.open) {
        this.revealTilesAfterMine(character, tile);
        this.statisticsInc.onTileMined(tile);
        this.handleTileDrops(tile);
        return true;
      }
      return false;
