    /**
     * @override
     */
    resetFull() {
      const grids = this.worldGrid.grids;
      for (let i = 0; i < grids.length; i++) {
        const grid = grids[i];
        if (grid) {
          this.gridLoader.unloadGrid(grid);
        }
      }
      this.crew = null;
      this.gridLoader = null;
    }
    /**
     * @override
     */
    resetForPrestige() {
      this.resetFull();
    }
